import React from "react";

const SearchBar = () => {
  return (
    <div className="container">
      <div className="row">
        <section className="col s4 offset-5">
          <form action="">
            <input placeholder="Search Movie" type="text" />
          </form>
        </section>
      </div>
    </div>
  );
};

export default SearchBar;
